import React from 'react';
import './Nav.css';
import pit from '../img/pit.jpg';
import { BrowserRouter as Router} from "react-router-dom";



class CNav extends React.Component {
    constructor(props){
        super(props);
        this.searchProducts= this.searchProducts.bind(this)
    }
    render() {
    return (<Router>
        <div class="home">
            <div class="nav">
                <ul>
                    <li><a class="active" href="/"><img alt="sorry" height="120%" width="15%" src={pit}/></a></li>
                    <li><a class="links" href="/login">LogOut</a></li>
                    <li><a class="links" href="/cart">MyCart</a></li>
                    <li><a class="links" href="/profile">MyProfile</a></li>
                    <li><input type="text" placeholder="Search products.." class="searchlink"/><button class="search" onClick={this.searchProducts}> Search </button></li>
                </ul>
            </div>  
          </div>
        </Router>
    );
    }
}
export default CNav;
